import React from 'react'
import SearchBar from './SearchBar'
import WeatherDisplay from './WeatherDisplay'

class Display extends React.Component{
    constructor () {
        super()
        this.state = {
            temperature : '10',
            precipitation: 'rain',
            wind: 'alot',
            summary: 'bad',

        }
    }

    render () {
        return (
            <div>
                <SearchBar />
                <WeatherDisplay 
                    data = {this.state}
                />
            </div>
        )
    }
}

export default Display
